import React,{useEffect, useState} from 'react';
import CommunityBoard from './Components/CommunityComponents/CommunityBoard';
import AboutMe from './Components/AboutMe';
import { BrowserRouter as Router, Route, Link} from "react-router-dom";
function Body (props){

	// let body = useEffect(function(){

	// });
	return(
		<div>
			<Router>
				<Route path="/AboutMe" component={AboutMe}></Route>
				<Route path="/CommunityBoard" component={CommunityBoard}></Route>
			</Router>
			
		</div>
	);
}
export default Body;
